                    $fbpixelscript.= "
                    function jmpPixelFbLead() {
					      window._fbq.push('track', 'Lead');
					  }";
                }
                if(in_array('Lead Anchor',$action)){
                    $fbpixelscript.= "
                    function jmpPixelFbClick(e,href) {
