					  }";
                }


				$fbpixelscript.= "</script>";

                if(in_array('Lead GForm',$action)){
                    $fbpixelscript.= "
                    <script type='text/javascript'>
                    jQuery(document).bind('gform_confirmation_loaded', function(event, formId){
